						["check"] = "update",
						["custom_type"] = "stateupdate",
						["custom"] = "function(allstates)\n    local Core = aura_env.GetTDACore()\n    if not Core then return end\n    \n    -- Get other trigger states:\n    local GS = WeakAuras.GetTriggerStateForTrigger\n    local S = {\n        DecimatingBolt = GS(aura_env.id, 3),\n        DemonicCore = GS(aura_env.id, 4),\n        EmpoweredDemonicCore = GS(aura_env.id, 5),\n        FromTheShadows = GS(aura_env.id, 6),\n    }\n    \n    -- Aura logic:\n    for unit in pairs(Core.supportedUnits) do\n        if UnitExists(unit) then\n            -- Self auras:\n            local DecimatingBolt = Core.GetStateForUnit(S.DecimatingBolt, unit)\n            local DemonicCore = Core.GetStateForUnit(S.DemonicCore, unit)\n            local EmpoweredDemonicCore = Core.GetStateForUnit(S.EmpoweredDemonicCore, unit)\n            \n            -- Target auras:\n            local FromTheShadows = Core.GetMatchedAura(unit, S.FromTheShadows, true, true)\n            \n            -- Aura display priority:\n            local state = DecimatingBolt and (DemonicCore or DecimatingBolt)\n            \n            -- Set Decimating Bolt stacks to state:\n            if state then\n                state.stacks = DecimatingBolt and DecimatingBolt.stacks or 0\n                state.showStacks = true\n            end\n            \n            -- Calculate danger level:\n            if state then\n                state.dangerLevel = 1\n                \n                if DecimatingBolt and DemonicCore and (EmpoweredDemonicCore or FromTheShadows) then\n                    state.dangerLevel = 3\n                elseif DecimatingBolt and DemonicCore then\n                    state.dangerLevel = 2\n                end\n            end\n            \n            -- Get target text:\n            if state then\n                state.targetText = Core.GetTargetText(aura_env, unit)\n            end\n            \n            -- Add aura:\n            allstates[unit] = state\n        end\n    end\n    \n    return true\nend",
