						["custom"] = "function(allstates)\n    local Core = aura_env.GetTDACore()\n    if not Core then return end\n    \n    -- Get other trigger states:\n    local GS = WeakAuras.GetTriggerStateForTrigger\n    local S = {\n        Dread = GS(aura_env.id, 3),\n        Rush = GS(aura_env.id, 4),\n        Crit = GS(aura_env.id, 5),\n    }\n    \n    -- Aura logic:\n    for unit in pairs(Core.supportedUnits) do\n        if UnitExists(unit) then\n            -- Self auras:\n            local Dread = Core.GetStateForUnit(S.Dread, unit)\n            local Rush = Core.GetStateForUnit(S.Rush, unit)\n            \n            -- Target auras:\n            local Crit = Core.GetMatchedAura(unit, S.Crit, true, true)\n            \n            -- Aura display priority:\n            local state = Dread or Rush or Crit\n            \n            -- Calculate danger level:\n            if state then\n                state.dangerLevel = 1\n                \n                if Dread and Rush or Dread and Crit then\n                    state.dangerLevel = 3\n                elseif Dread or Rush then\n                    state.dangerLevel = 2\n                end\n            end\n            \n            -- Get target text:\n            if state then\n                state.targetText = Core.GetTargetText(aura_env, unit)\n            end\n            \n            -- Add aura:\n            allstates[unit] = state\n        end\n    end\n    \n    return true\nend",
