						["custom_type"] = "stateupdate",
						["custom"] = "function(allstates)\n    local Core = aura_env.GetTDACore()\n    if not Core then return end\n    \n    -- Get other trigger states:\n    local GS = WeakAuras.GetTriggerStateForTrigger\n    local S = {\n        Magi = GS(aura_env.id, 3),\n        ArcanePower = GS(aura_env.id, 4),\n        RuneOfPower = GS(aura_env.id, 5),\n        Clearcasting = GS(aura_env.id, 6),\n    }\n    \n    -- Aura logic:\n    for unit in pairs(Core.supportedUnits) do\n        if UnitExists(unit) then\n            -- Self auras:\n            local ArcanePower = Core.GetStateForUnit(S.ArcanePower, unit)\n            local RuneOfPower = Core.GetStateForUnit(S.RuneOfPower, unit)\n            local Clearcasting = Core.GetStateForUnit(S.Clearcasting, unit)\n            \n            -- Target auras:\n            local Magi = Core.GetMatchedAura(unit, S.Magi, true, false)\n            \n            -- Aura display priority:\n            local state = Magi or ArcanePower or RuneOfPower\n            \n            -- Calculate danger level:\n            if state then\n                state.dangerLevel = 1\n                \n                if ArcanePower or RuneOfPower and Magi or Magi and Clearcasting and Clearcasting.stacks and Clearcasting.stacks >= 3 then\n                    state.dangerLevel = 3\n                elseif RuneOfPower or Magi and Clearcasting and Clearcasting.stacks and Clearcasting.stacks >= 2 then\n                    state.dangerLevel = 2\n                end\n            end\n            \n            -- Get target text:\n            if state then\n                state.targetText = Core.GetTargetText(aura_env, unit, Magi and Magi.unit)\n            end\n            \n            -- Add extra text:\n            if state and Magi then\n                state.extraText = Magi and Magi.tooltip1 and AbbreviateNumbers(tonumber(Magi.tooltip1))\n            end\n            \n            -- Add aura:\n            allstates[unit] = state\n        end\n    end\n    \n    return true\nend",
