						["custom_type"] = "stateupdate",
						["custom"] = "function(allstates)\n    local Core = aura_env.GetTDACore()\n    if not Core then return end\n    \n    -- Get other trigger states:\n    local GS = WeakAuras.GetTriggerStateForTrigger\n    local S = {\n        DarkSoul = GS(aura_env.id, 3),\n        Rapid = GS(aura_env.id, 4),\n        Demise = GS(aura_env.id, 5),\n        Phantom = GS(aura_env.id, 6),\n        SoulRotOnPlayer = GS(aura_env.id, 7),\n        SoulRot = GS(aura_env.id, 8),\n    }\n    \n    -- Aura logic:\n    for unit in pairs(Core.supportedUnits) do\n        if UnitExists(unit) then\n            -- Self auras:\n            local DarkSoul = Core.GetStateForUnit(S.DarkSoul, unit)\n            local Rapid = Core.GetStateForUnit(S.Rapid, unit)\n            local Demise = Core.GetStateForUnit(S.Demise, unit)\n            \n            -- Target auras:\n            local Phantom = Core.GetMatchedAura(unit, S.Phantom, true, false)\n            local SoulRotOnPlayer = Core.GetMatchedAura(unit, S.SoulRotOnPlayer, true, false)\n            local SoulRot = Core.GetMatchedAura(unit, S.SoulRot, true, false)\n            \n            -- Aura display priority:\n            local state = DarkSoul or Rapid or Demise and Demise.stacks >= 40 and Demise or nil\n            \n            -- Set Demise stacks to main state:\n            if state then\n                state.stacks = Demise and Demise.stacks or 0\n                state.showStacks = true\n            end\n            \n            -- Calculate danger level:\n            if state then\n                state.dangerLevel = 1\n                \n                if DarkSoul and (Rapid or Phantom or SoulRot or Demise and Demise.stacks >= 40) then\n                    state.dangerLevel = 3\n                elseif DarkSoul or (SoulRot and Demise and Demise.stacks >= 40) or Rapid and Phantom and SoulRot then\n                    state.dangerLevel = 2\n                end\n            end\n            \n            -- Get target text:\n            if state then\n                state.targetText = Core.GetTargetText(aura_env, unit)\n            end\n            \n            -- Add aura:\n            allstates[unit] = state\n            \n            -- Add extra aura:\n            if SoulRotOnPlayer and SoulRotOnPlayer.unit then\n                SoulRotOnPlayer.dangerLevel = state and state.dangerLevel or 1\n                SoulRotOnPlayer.index = 1\n                if state then state.index = 100 end\n                SoulRotOnPlayer.showStacks = false\n                SoulRotOnPlayer.targetText = Core.GetTargetText(aura_env, unit, SoulRotOnPlayer.unit)\n                allstates[unit .. \"_Extra\"] = SoulRotOnPlayer\n            else\n                allstates[unit .. \"_Extra\"] = nil\n            end\n        end\n    end\n    \n    return true\nend",
