						["custom"] = "function(allstates)\n    local Core = aura_env.GetTDACore()\n    if not Core then return end\n    \n    -- Get other trigger states:\n    local GS = WeakAuras.GetTriggerStateForTrigger\n    local S = {\n        STM = GS(aura_env.id, 3),\n        Voidform = GS(aura_env.id, 4),\n        PI = GS(aura_env.id, 5),\n        Psyfiend = GS(aura_env.id, 6),\n        UnholyNova = GS(aura_env.id, 7),\n        Mindgames = GS(aura_env.id, 8),\n    }\n    \n    -- Aura logic:\n    for unit in pairs(Core.supportedUnits) do\n        if UnitExists(unit) then\n            -- Self auras:\n            local STM = Core.GetStateForUnit(S.STM, unit)\n            local Voidform = Core.GetStateForUnit(S.Voidform, unit)\n            local PI = Core.GetStateForUnit(S.PI, unit)\n            \n            -- Target auras:\n            local Psyfiend = Core.GetMatchedAura(unit, S.Psyfiend, false, false)\n            local UnholyNova = Core.GetMatchedAura(unit, S.UnholyNova, true, false)\n            local Mindgames = Core.GetMatchedAura(unit, S.Mindgames, true, false)\n            \n            -- Aura display priority:\n            local state = STM or Voidform\n            \n            -- Calculate danger level:\n            if state then\n                state.dangerLevel = 1\n                \n                if STM and Voidform or Voidform and (PI or Psyfiend or UnholyNova or Mindgames) then\n                    state.dangerLevel = 3\n                elseif Voidform then\n                    state.dangerLevel = 2\n                end\n            end\n            \n            -- Get target text:\n            if state then\n                state.targetText = Core.GetTargetText(aura_env, unit)\n            end\n            \n            -- Add aura:\n            allstates[unit] = state\n        end\n    end\n    \n    return true\nend",
