						["custom_type"] = "stateupdate",
						["custom"] = "function(allstates)\n    local Core = aura_env.GetTDACore()\n    if not Core then return end\n    \n    -- Get other trigger states:\n    local GS = WeakAuras.GetTriggerStateForTrigger\n    local S = {\n        Meta = GS(aura_env.id, 3),\n        DemonSoul = GS(aura_env.id, 4),\n        UnboundChaos = GS(aura_env.id, 5),\n    }\n    \n    -- Aura logic:\n    for unit in pairs(Core.supportedUnits) do\n        if UnitExists(unit) then\n            -- Self auras:\n            local Meta = Core.GetStateForUnit(S.Meta, unit)\n            local DemonSoul = Core.GetStateForUnit(S.DemonSoul, unit)\n            local UnboundChaos = Core.GetStateForUnit(S.UnboundChaos, unit)\n            \n            -- Aura display priority:\n            local state = UnboundChaos or Meta or DemonSoul\n            \n            -- Combine aura texts:\n            if state then\n                if UnboundChaos and (Meta or DemonSoul) then\n                    state.combineTexts = { UnboundChaos.triggernum, Meta and DemonSoul and 10 or Meta and Meta.triggernum or DemonSoul and DemonSoul.triggernum }\n                elseif Meta and DemonSoul then\n                    state.combineTexts = { Meta.triggernum, DemonSoul.triggernum }\n                else\n                    state.combineTexts = nil\n                end\n            end\n            \n            -- Calculate danger level:\n            if state then\n                state.dangerLevel = 1\n                \n                if Meta then\n                    state.dangerLevel = 3\n                elseif DemonSoul then\n                    state.dangerLevel = 2\n                end\n            end\n            \n            -- Get target text:\n            if state then\n                state.targetText = Core.GetTargetText(aura_env, unit)\n            end\n            \n            -- Add aura:\n            allstates[unit] = state\n        end\n    end\n    \n    return true\nend",
