						["custom_type"] = "stateupdate",
						["custom"] = "function(allstates)\n    local Core = aura_env.GetTDACore()\n    if not Core then return end\n    \n    -- Get other trigger states:\n    local GS = WeakAuras.GetTriggerStateForTrigger\n    local S = {\n        Final = GS(aura_env.id, 3),\n        Seraphim = GS(aura_env.id, 4),\n        BigWings = GS(aura_env.id, 5),\n        Wings = GS(aura_env.id, 6),\n    }\n    \n    -- Aura logic:\n    for unit in pairs(Core.supportedUnits) do\n        if UnitExists(unit) then\n            -- Self auras:\n            local Seraphim = Core.GetStateForUnit(S.Seraphim, unit)\n            local BigWings = Core.GetStateForUnit(S.BigWings, unit)\n            local Wings = Core.GetStateForUnit(S.Wings, unit)\n            \n            -- Target auras:\n            local Final = Core.GetMatchedAura(unit, S.Final, true, true)\n            \n            -- Aura display priority:\n            local state = Final or Seraphim or BigWings or Wings\n            \n            -- Calculate danger level:\n            if state then\n                state.dangerLevel = 1\n                \n                if Seraphim and Wings or Seraphim and Final or Wings and Final then\n                    state.dangerLevel = 3\n                elseif Seraphim or BigWings then\n                    state.dangerLevel = 2\n                end\n            end\n            \n            -- Get target text:\n            if state then\n                state.targetText = Core.GetTargetText(aura_env, unit)\n            end\n            \n            -- Add aura:\n            allstates[unit] = state\n        end\n    end\n    \n    return true\nend",
