				["init"] = {
					["custom"] = "-- ###### DO NOT CHANGE BELOW ######\n\nlocal version = 1.03\nlocal isDebug = false\nif aura_env.TeeaDangerAlertsCore and aura_env.TeeaDangerAlertsCore.version and aura_env.TeeaDangerAlertsCore.version > version then\n    return\nend\naura_env.TeeaDangerAlertsCore = aura_env.TeeaDangerAlertsCore or {}\nlocal Core = aura_env.TeeaDangerAlertsCore\nCore.version = version\n\nlocal supportedUnits = {}\nfor i=1, 10 do supportedUnits[\"arena\" .. i] = true end\nif isDebug then\n    supportedUnits[\"player\"] = true\n    for i=1, 40 do supportedUnits[\"nameplate\" .. i] = true end\nend\nCore.supportedUnits = supportedUnits\n\nCore.GetStateForUnit = function(states, unit)\n    for _, state in pairs(states) do\n        if state.unit == unit then\n            return state\n        end\n    end\nend\n\nCore.GetMatchedAura = function(unit, states, isMatchCaster, isMatchTarget, specificTarget)\n    if not states then return end\n    local targetUnit = specificTarget or isMatchTarget and unit .. \"target\"\n    for _, state in pairs(states) do\n        if (\n            (not isMatchCaster or state.unitCaster and UnitIsUnit(state.unitCaster, unit))\n            and (not targetUnit or state.unit and UnitIsUnit(state.unit, targetUnit))\n        ) then\n            return state\n        end\n    end\nend\n\nCore.GetMatchedCast = function(unit, states, isMatchCaster)\n    if not states then return end\n    for _, state in pairs(states) do\n        if (\n            (not isMatchCaster or state.sourceGUID and state.sourceGUID == UnitGUID(unit))\n        ) then\n            return state\n        end\n    end\nend\n\nlocal classMap = {\n    [\"DEMONHUNTER\"] = \"DH\",\n    [\"DEATHKNIGHT\"] = \"DK\",\n}\nCore.GetTargetText = function(env, unit, targetUnit)\n    local text\n    \n    targetUnit = targetUnit or (unit .. \"target\")\n    if UnitExists(targetUnit) and UnitIsFriend(targetUnit, \"player\") then\n        if UnitIsUnit(targetUnit, \"player\") then -- Player\n            text = \"You\"\n        elseif UnitIsPlayer(targetUnit) then -- Other players\n            if env.config.isClassNamesTargetText then\n                local _, classText = UnitClass(targetUnit)\n                text = classText and classMap[classText] or classText\n            else\n                text = UnitName(targetUnit)\n            end\n        end\n    end\n    \n    if text then \n        -- Shorten:\n        if env.config.maxTargetTextLength > 0 and not env.config.isClassNamesTargetText then\n            text = WA_Utf8Sub(text, env.config.maxTargetTextLength)\n        end\n        \n        -- Class color:\n        if env.config.isClassColoredTargetText then\n            text = GetClassColoredTextForUnit(targetUnit, text)\n        end\n    end\n    \n    return text\nend\n\nCore.FormatText = function(env, triggerNum, targetText)\n    local mappedVal\n    if not env or not env.triggerNameMap then return end\n    if env.state and env.state.combineTexts then\n        mappedVal = string.format(\"%s\\n%s\", env.triggerNameMap[env.state.combineTexts[1]], env.triggerNameMap[env.state.combineTexts[2]])\n    else\n        mappedVal = triggerNum and env.triggerNameMap[triggerNum]\n    end\n    if not mappedVal then return end\n    \n    local text = mappedVal\n    \n    if env.state and env.state.extraText then\n        text = string.format(\"%s\\n%s\", text, env.state.extraText)\n    end\n    \n    if targetText and env.config.isShowTargetText then\n        text = string.format(\"%s\\n%s\", text, targetText)\n    end\n    \n    return text\nend\n\nCore.GetActiveTriggers = function(env)\n    local activeTriggers = WeakAuras.GetActiveTriggers(env.id)\n    local count = 0\n    for _, v in pairs(activeTriggers) do\n        if v then count = count + 1 end\n    end\n    return activeTriggers, count\nend\n\nCore.TeeaGlowFix = function(env, region)\n    if not env or not region then return end\n    if not env.config.isApplyGlowFix then return end\n    for _, v in pairs(region.subRegions) do\n        local f = v.glow and v._ButtonGlow\n        if f then\n            local width, height = v:GetSize()\n            f.ants:SetSize(width*1.4 * 0.88, height*1.4 * 0.88)\n            f.ants:SetPoint(\"CENTER\", 0, -0.5)\n        end\n    end\n    region.applyTeeaGlowFix = nil\nend\n\nCore.QueueGlowFix = function(env, region)\n    if not env or not region then return end\n    region.applyTeeaGlowFix = env.config.isApplyGlowFix\nend\n\nCore.isLoaded = true\n\nWeakAuras.ScanEvents(\"TEEA_DANGER_ALERTS_ENV\", Core)",
