						["custom"] = "function(allstates)\n    local Core = aura_env.GetTDACore()\n    if not Core then return end\n    \n    -- Get other trigger states:\n    local GS = WeakAuras.GetTriggerStateForTrigger\n    local S = {\n        IcyVeins = GS(aura_env.id, 3),\n        IceForm = GS(aura_env.id, 4),\n        RuneOfPower = GS(aura_env.id, 5),\n    }\n    \n    -- Aura logic:\n    for unit in pairs(Core.supportedUnits) do\n        if UnitExists(unit) then\n            -- Self auras:\n            local IcyVeins = Core.GetStateForUnit(S.IcyVeins, unit)\n            local IceForm = Core.GetStateForUnit(S.IceForm, unit)\n            local RuneOfPower = Core.GetStateForUnit(S.RuneOfPower, unit)\n            \n            -- Aura display priority:\n            local state = IceForm or IcyVeins or RuneOfPower\n            \n            -- Calculate danger level:\n            if state then\n                state.dangerLevel = 1\n                \n                if IceForm or IcyVeins then\n                    state.dangerLevel = 3\n                elseif RuneOfPower then\n                    state.dangerLevel = 2\n                end\n            end\n            \n            -- Get target text:\n            if state then\n                state.targetText = Core.GetTargetText(aura_env, unit)\n            end\n            \n            -- Add aura:\n            allstates[unit] = state\n        end\n    end\n    \n    return true\nend",
