						["custom_type"] = "stateupdate",
						["custom"] = "function(allstates)\n    local Core = aura_env.GetTDACore()\n    if not Core then return end\n    \n    -- Get other trigger states:\n    local GS = WeakAuras.GetTriggerStateForTrigger\n    local S = {\n        Vesper = GS(aura_env.id, 3),\n        Stormkeeper = GS(aura_env.id, 4),\n        Ascendance = GS(aura_env.id, 5),\n        Skyfury = GS(aura_env.id, 6),\n        EchoingShock = GS(aura_env.id, 7),\n    }\n    \n    -- Aura logic:\n    for unit in pairs(Core.supportedUnits) do\n        if UnitExists(unit) then\n            -- Self auras:\n            local Stormkeeper = Core.GetStateForUnit(S.Stormkeeper, unit)\n            local Ascendance = Core.GetStateForUnit(S.Ascendance, unit)\n            local Skyfury = Core.GetStateForUnit(S.Skyfury, unit)\n            local EchoingShock = Core.GetStateForUnit(S.EchoingShock, unit)\n            \n            -- Casts:\n            local Vesper = Core.GetMatchedCast(unit, S.Vesper, true)\n            \n            -- Aura display priority:\n            local state = Vesper or Stormkeeper or Ascendance or Skyfury or EchoingShock\n            \n            local StormAscendance = Stormkeeper or Ascendance\n            \n            -- Combine aura texts and set Stormkeeper stacks to main state (Vesper Totem perhaps):\n            if state then\n                state.stacks = Stormkeeper and Stormkeeper.stacks or 0\n                state.showStacks = true\n                if Vesper then\n                    state.combineTexts = Vesper and (Skyfury or EchoingShock) and { Vesper.triggernum, Skyfury and Skyfury.triggernum or EchoingShock and EchoingShock.triggernum } or nil\n                else\n                    state.combineTexts = StormAscendance and (Skyfury or EchoingShock) and { StormAscendance.triggernum, Skyfury and Skyfury.triggernum or EchoingShock and EchoingShock.triggernum } or nil\n                end\n            end\n            \n            -- Calculate danger level:\n            if state then\n                state.dangerLevel = 1\n                \n                if Vesper or StormAscendance and Skyfury or StormAscendance and EchoingShock then\n                    state.dangerLevel = 3\n                elseif StormAscendance or Skyfury then\n                    state.dangerLevel = 2\n                end\n            end\n            \n            -- Get target text:\n            if state then\n                state.targetText = Core.GetTargetText(aura_env, unit)\n            end\n            \n            -- Add aura:\n            allstates[unit] = state\n        end\n    end\n    \n    return true\nend",
